        $(document).on('click', '.pfw-bulk-add-button', function(){

            let button = $(this);
            //check if every thing products variation are set
            let table = $(this).closest('.pfw-product-table');

            let selected_product_add_to_cart_div = [];

            _.each(table.find('.pfw-product-checkbox[type=checkbox]:checked'), function(box){
                selected_product_add_to_cart_div.push($(box).closest('tr').find('.pfw-add-to-cart-group'));
            });

            //create an array to store the variable products
            let invalid_variable_product_rows = [];
            //check the data div and see if there are variable products and they have variation set
            _.each(selected_product_add_to_cart_div, function(data_div){
                data_div = $(data_div);
                let product_type = data_div.attr('data-type');
                if (product_type === 'variable' && typeof data_div.attr('data-product-id') === 'undefined' || parseInt(data_div.attr('data-product-id')) === 0)
                {
                    invalid_variable_product_rows.push(data_div.closest('tr'));
                }

            });

            if (invalid_variable_product_rows.length > 0)
            {
                console.log('ooops');
                //if there are error rows, add the error class and return
                _.each(invalid_variable_product_rows, function(row){
                    $(row).addClass('pfw-error-row');

                    setTimeout(function(){
                        $(row).removeClass('pfw-error-row');
                    }, 4000);

                });

                return;


            }

            //now add all products to cart
            let products = [];

            _.each(selected_product_add_to_cart_div, function(data_div){
                let qty = $(data_div).find('.pfw-order-quantity').first().val();

                let product_id = $(data_div).attr('data-parent-product-id');

                if (data_div.attr('data-type') === 'variable')
                    product_id = $(data_div).attr('data-product-id');

                if (qty > 0 && product_id > 0)
                    products.push({
                        'product_id' : product_id,
                        'quantity' : qty
                    })

            });

            //send request
            button.addClass('loading');

            jQuery.post(ajaxurl, {
                action: 'pfw_add_items_from_cart',
                products: products
            }, function(response){
                _.each(response.fragments, function(item, index){
                    $(index).replaceWith(item);
                });
               console.log(response);
               button.removeClass('loading');
            });


        });



